package miniJava.SyntacticAnalyzer;

import java.io.IOException;
import java.io.InputStream;

import miniJava.ErrorReporter;
import miniJava.SyntacticAnalyzer.Token;
import miniJava.SyntacticAnalyzer.TokenKind;

public class Scanner {
	private boolean isComment;
	
//	comment state = 0 not comment
//			= 1 show /
//			= 2 show second /
//			= 12 show first *
//			= 13 show second *
//			= 3 show third /
//			= 4 show fourth / end of comment
//			= 14 show second / end of comment
	private int commentState;
	
	private InputStream inputStream;
	private ErrorReporter reporter;
	
	private char currentChar;
	private byte currentKind;
	private StringBuilder currentSpelling;
	
	// true when end of line is found
	private boolean eot = false; 
	
	public Scanner(InputStream inputStream, ErrorReporter reporter) {
		this.isComment = false;
		this.commentState = 0;
		this.inputStream = inputStream;
		this.reporter = reporter;

		// initialize scanner state
		readChar();
	}	
	
	/**
	 * skip whitespace and scan next token
	 */	
	
// ? SINGLE SLASH
//	comment state = 0 not comment
//	= 1 show /
//	= 2 show second /
//	= 12 show first *
//	= 13 show second *
//	= 14 show second / end of comment
	public void scanSeparator() {
		switch (commentState) {
			case 0:
				while (!eot && 
						(currentChar == ' ' ||
							currentChar == '\t' ||
								currentChar == '\n' ||
									currentChar == '\r')) {
					skipIt();
				}
				if (currentChar == '/') {
					commentState = 1;
					skipIt();
					scanSeparator();
				}
				break;
			
			case 1:
				if (currentChar == '/') {
					commentState = 2;
					isComment = true;
					skipIt();
					scanSeparator();
				} else if (currentChar == '*') {
					commentState = 12;
					isComment = true;
					skipIt();
					scanSeparator();
				} else {
					System.exit(4);
				}
				break;
			
			case 2:
				if (currentChar == '\r' || currentChar == '\n' || eot) {
					commentState = 0;
					isComment = false;
					scanSeparator();
				} else {
					skipIt();
					scanSeparator();		
				}
				break;
				
			case 12:
				if (eot) {
					System.exit(4);
				}
				if (currentChar != '*') {
					skipIt();
					scanSeparator();
				} else {
					commentState = 13;
					scanSeparator();
				}
				break;
			
			case 13:
				if (eot) {
					System.exit(4);
				}
				if (currentChar != '/') {
					skipIt();
					commentState = 12;
					scanSeparator();
				} else {
					commentState = 0;
					isComment = false;
					scanSeparator();
				}
				break;	
		}		
	}
	

	public Token scan() {
		// skip whitespace and comments
		scanSeparator();

		// start of a token: collect spelling and identify token kind
		currentSpelling = new StringBuilder();
		TokenKind kind = scanToken();
		String spelling = currentSpelling.toString();
		
		if (kind == TokenKind.ID) {
			switch (spelling) {
			case "class":
				kind = TokenKind.CLASS;
				break;
			case "public":
				kind = TokenKind.PUBLIC;
				break;
			case "private":
				kind = TokenKind.PRIVATE;
				break;
			case "static":
				kind = TokenKind.STATIC;
				break;
			case "int":
				kind = TokenKind.INT;
				break;
			case "boolean":
				kind = TokenKind.BOOLEAN;
				break;
			case "void":
				kind = TokenKind.VOID;
				break;
			case "this":
				kind = TokenKind.THIS;
				break;
			case "return":
				kind = TokenKind.RETURN;
				break;
			case "if":
				kind = TokenKind.IF;
				break;
			case "else":
				kind = TokenKind.ELSE;
				break;
			case "while":
				kind = TokenKind.WHILE;
				break;
			case "true":
				kind = TokenKind.TRUE;
				break;
			case "false":
				kind = TokenKind.FALSE;
				break;
			default:
				String[] ss = {"class","public","private","static","int","boolean","void","this","return","if","else","while","true","false"};
				for (String s : ss) {
					if (spelling.toLowerCase().equals(s)) {
						reporter.reportError("Key word should not be used as identifiers.");
						System.exit(4);
					}
				}
				break;
			}
		}

		// return new token
		return new Token(kind, spelling);
	}

	
	/**
	 * determine token kind
	 */
	public TokenKind scanToken() {
		if (eot) {
			return TokenKind.EOT; 
		}
			
		switch (currentChar) {
			case 'a':  case 'b':  case 'c':  case 'd':
			case 'e':  case 'f':  case 'g':  case 'h':
			case 'i':  case 'j':  case 'k':  case 'l':
			case 'm':  case 'n':  case 'o':  case 'p':
			case 'q':  case 'r':  case 's':  case 't':
	        case 'u':  case 'v':  case 'w':  case 'x':
	        case 'y':  case 'z':
	        
	        case 'A':  case 'B':  case 'C':  case 'D':
	        case 'E':  case 'F':  case 'G':  case 'H':
	        case 'I':  case 'J':  case 'K':  case 'L':
	        case 'M':  case 'N':  case 'O':	 case 'P':
	        case 'Q':  case 'R':  case 'S':  case 'T':
	        case 'U':  case 'V':  case 'W':  case 'X':
	        case 'Y':  case 'Z':
	        	takeIt();
	        	while(Character.isLetter(currentChar) 
	        			|| Character.isDigit(currentChar)
	        				|| currentChar == '_') {
	        		takeIt();
	        	}
	        	return TokenKind.ID;
	        
	        case '0':  case '1':  case '2':  case '3':  case '4':
	        case '5':  case '6':  case '7':  case '8':  case '9':
	            takeIt();
	            while(Character.isDigit(currentChar)) {
	            	takeIt();
	            }
	            return TokenKind.NUM;
	        
	        case '>': case '<': case '=':
	            takeIt();
	            if(currentChar == '=') {
	                takeIt();
	                return TokenKind.BINOP;
	            }
	            return TokenKind.BINOP;
	        
	        case '+': case '*': case '/':
	        	takeIt();
	        	return TokenKind.BINOP;
	        
	        case '&':
	            takeIt();
	            if(currentChar != '&') {
	                System.exit(4);
	            }
	            takeIt();
	            return TokenKind.BINOP;

	        case '|':
	            takeIt();
	            if(currentChar != '|')
	                System.exit(4);
	            takeIt();
	            return TokenKind.BINOP;
	        
	        case '!':
	            takeIt();
	            if(currentChar == '=') {
	                takeIt();
	                return TokenKind.BINOP;
	            }
	            return TokenKind.UNOP;
	            
	        case '-':
	            takeIt();
	            return TokenKind.BUNOP;
	        
	        case '.':
	            takeIt();
	            return TokenKind.DOT;

	        case ',':
	            takeIt();
	            return TokenKind.COMMA;

	        case ';':
	            takeIt();
	            return TokenKind.SEMICOLON;

	        case '(':
	            takeIt();
	            return TokenKind.LPAREN;

	        case ')':
	            takeIt();
	            return TokenKind.RPAREN;

	        case '[':
	            takeIt();
	            return TokenKind.LBRACKET;

	        case ']':
	            takeIt();
	            return TokenKind.RBRACKET;

	        case '{':
	            takeIt();
	            return TokenKind.LCURLY;

	        case '}':
	            takeIt();
	            return TokenKind.RCURLY;
	        
	        default:
				scanError("Unrecognized character '" + currentChar + "' in input");
				return TokenKind.ERROR; 
		}
	}

	
	private void takeIt() {
		currentSpelling.append(currentChar);
		nextChar();
	}
	
	private void take(char expectedChar) {
		if (currentChar == expectedChar) {
			takeIt();
		}
	}

	private void skipIt() {
		nextChar();
	}


	private void scanError(String m) {
		reporter.reportError("Scan Error:  " + m);
	}


	private final static char eolUnix = '\n';
	private final static char eolWindows = '\r';

	/**
	 * advance to next char in inputstream
	 * detect end of file or end of line as end of input
	 */
	private void nextChar() {
		if (!eot)
			readChar();
	}

	private void readChar() {
		try {
			int c = inputStream.read();
			currentChar = (char) c;
			if (c == -1 || currentChar == eolUnix || currentChar == eolWindows) {
				eot = true;
			}
		} catch (IOException e) {
			scanError("I/O Exception!");
			eot = true;
		}
	}
	


}

package miniJava;

import java.io.FileInputStream;
import java.io.FileNotFoundException;
import java.io.InputStream;

import miniJava.SyntacticAnalyzer.Parser;
import miniJava.SyntacticAnalyzer.Scanner;

public class Compiler {
	public static void main(String[] args) {
		InputStream inputStream = null;
		try {
			inputStream = new FileInputStream(args[0]);
		} catch (FileNotFoundException e) {
			System.out.println("Input file " + args[0] + " not found");
			System.exit(1);
		}
		
		ErrorReporter errorReporter = new ErrorReporter();
		Scanner scanner = new Scanner(inputStream, errorReporter);
		Parser parser = new Parser(scanner, errorReporter);
		
		System.out.println("Syntactic analysis ... ");
		parser.parse();
		System.out.print("Sytactic analysis complete: ");
		if (errorReporter.hasErrors()) {
			System.out.println("Invalid miniJava program");
			System.exit(4);
		}
		else {
			System.out.println("Valid miniJava program");
			System.exit(0);
		}
	}
}

package miniJava.SyntacticAnalyzer;

import miniJava.SyntacticAnalyzer.Scanner;
import miniJava.SyntacticAnalyzer.TokenKind;
import miniJava.ErrorReporter;

public class Parser {
	private Scanner scanner;
	private ErrorReporter reporter;
	private Token currentToken;

	public Parser(Scanner scanner, ErrorReporter reporter) {
		this.scanner = scanner;
		this.reporter = reporter;
	}


	/**
	 *  parse input, catch possible parse error
	 */
	public void parse() {
		currentToken = scanner.scan();
		try {
			parseProgram();
		}
		catch (SyntaxError e) { }
	}
	
	private boolean startsDeclaration(TokenKind kind) {
		return kind == TokenKind.PUBLIC ||
				kind == TokenKind.PRIVATE ||
				 kind == TokenKind.STATIC ||
				  startsType(kind) ||
					 kind == TokenKind.VOID;
	}
	
	private boolean startsType(TokenKind kind) {
		return kind == TokenKind.INT ||
				   kind == TokenKind.BOOLEAN ||
					kind == TokenKind.ID;
	}

	
	//   
	private void parseProgram() throws SyntaxError {
		accept(TokenKind.CLASS);
		parseId();
		accept(TokenKind.LCURLY);
		
		while (startsDeclaration(currentToken.kind)) {
			parseVisibility();
			parseAccess();
			switch(currentToken.kind) {
				case VOID:
					parseId();
					accept(TokenKind.LPAREN);
					if (startsType(currentToken.kind)) {
						parseParameterList();
					}
					accept(TokenKind.RPAREN);
					accept(TokenKind.LCURLY);
					
					while (startsStatement(currentToken.kind)) {
						parseStatement();
					}
					accept(TokenKind.RCURLY);
					break;
					
				default:
					if (startsType(currentToken.kind)) {
						parseType();
						parseId();
						switch(currentToken.kind) {
						case SEMICOLON:
							accept(TokenKind.SEMICOLON);
							break;
						case ID:
							parseId();
							accept(TokenKind.LPAREN);
							if (startsType(currentToken.kind)) {
								parseParameterList();
							}
							accept(TokenKind.RPAREN);
							accept(TokenKind.LCURLY);
							
							while (startsStatement(currentToken.kind)) {
								parseStatement();
							}
							accept(TokenKind.RCURLY);
							break;
						}
					}
					else {
						parseError("Parsing wrong in declarations");
					}
					
			}
		}
		
		accept(TokenKind.RCURLY);
		accept(TokenKind.EOT);
	}
	
	private void parseStatement() throws SyntaxError {
		switch (currentToken.kind) {
		case LCURLY:
			acceptIt();
			while (startsStatement(currentToken.kind)) {
				parseStatement();
			}
			accept(TokenKind.RCURLY);
			break;
			
		case INT: case BOOLEAN:
			parseType();
			parseId();
			accept(TokenKind.EQUAL);
			parseExpression();
			accept(TokenKind.SEMICOLON);
			break;
		
		case ID:
			acceptIt();
			
			switch (currentToken.kind) {
			// in Type
			case ID:
			acceptIt();
			accept(TokenKind.EQUAL);
			parseExpression();
			accept(TokenKind.SEMICOLON);
			break;
			
			// in Reference
			case EQUAL:
			acceptIt();
			parseExpression();
			accept(TokenKind.SEMICOLON);
			break;
			
			case LPAREN:
			acceptIt();
			if (currentToken.kind == TokenKind.RPAREN) {
				acceptIt();
			} else {
				parseArgumentList();
				accept(TokenKind.RPAREN);
			}
			accept(TokenKind.SEMICOLON);
			break;
			
			// both
			case LBRACKET: 
			acceptIt();
			// in Type
			if (currentToken.kind == TokenKind.RBRACKET) {
				acceptIt();
				accept(TokenKind.ID);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
			} else {
				// in Reference
				parseExpression();
				accept(TokenKind.RBRACKET);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
			}
			break;
			
			case DOT:
			while (currentToken.kind == TokenKind.DOT) {
				acceptIt();
				accept(TokenKind.ID);
			}
			switch (currentToken.kind) {
			case EQUAL:
				acceptIt();
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
			
			case LBRACKET: 
				acceptIt();
				parseExpression();
				accept(TokenKind.RBRACKET);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
			
			case LPAREN:
				acceptIt();
				if (currentToken.kind == TokenKind.RPAREN) {
					acceptIt();
				} else {
					parseArgumentList();
					accept(TokenKind.RPAREN);
				}
				accept(TokenKind.SEMICOLON);
				break;
			}
			}
			break;
		
		case THIS:
			acceptIt();
			while (currentToken.kind == TokenKind.DOT) {
				acceptIt();
				accept(TokenKind.ID);
			}
			switch (currentToken.kind) {
			case EQUAL:
				acceptIt();
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
			
			case LBRACKET:
				acceptIt();
				parseExpression();
				accept(TokenKind.RBRACKET);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
				
			case LPAREN:
				acceptIt();
				if (currentToken.kind == TokenKind.RPAREN) {
					acceptIt();
					accept(TokenKind.SEMICOLON);
				} else {
					parseArgumentList();
					accept(TokenKind.RPAREN);
					accept(TokenKind.SEMICOLON);
				}
				break;
			}
			break;
			
		case RETURN:
			acceptIt();
			if (currentToken.kind == TokenKind.SEMICOLON) {
				acceptIt();
			} else {
				parseExpression();
				accept(TokenKind.SEMICOLON);
			}
			break;
		
		case IF:
			acceptIt();
			accept(TokenKind.LPAREN);
			parseExpression();
			accept(TokenKind.RPAREN);
			parseStatement();
			if (currentToken.kind == TokenKind.ELSE) {
				acceptIt();
				parseStatement();
			}
			break;
			
		case WHILE:
			acceptIt();
			accept(TokenKind.LPAREN);
			parseExpression();
			accept(TokenKind.RPAREN);
			parseStatement();
			break;
		// default error
		}
		return ;
		
	}


	private void parseArgumentList() {
		// TODO Auto-generated method stub
		parseExpression();
		while (currentToken.kind == TokenKind.COMMA) {
			acceptIt();
			parseExpression();
		}
	}


	private void parseExpression() {
		// TODO Auto-generated method stub
		switch (currentToken.kind) {
		case ID: case THIS:
			acceptIt();
			while (currentToken.kind == TokenKind.DOT) {
				acceptIt();
				accept(TokenKind.ID);
			}
			switch (currentToken.kind) {
			case LBRACKET:
				acceptIt();
				parseExpression();
				accept(TokenKind.RBRACKET);
				break;
			
			case LPAREN:
				acceptIt();
				if (currentToken.kind == TokenKind.RPAREN) {
					acceptIt();
				} else {
					parseArgumentList();
					accept(TokenKind.RPAREN);
				}
				break;
				
			// just reference
			default:
			}
			
		case UNOP:
			acceptIt();
			parseExpression();
			break;
		
		case LPAREN:
			acceptIt();
			parseExpression();
			accept(TokenKind.RPAREN);
			break;
		
		case NUM: case TRUE: case FALSE:
			acceptIt();
			break;
		
		case NEW:
			acceptIt();
			switch (currentToken.kind) {
			case ID:
				acceptIt();
				switch (currentToken.kind) {
				case LPAREN:
					acceptIt();
					accept(TokenKind.RPAREN);
					break;
				case LBRACKET:
					acceptIt();
					parseExpression();
					accept(TokenKind.RBRACKET);
					break;
				
				}
			
			case INT:
				acceptIt();
				accept(TokenKind.LBRACKET);
				parseExpression();
				accept(TokenKind.RBRACKET);
				break;
			}
			break;
		}
		if (currentToken.kind == TokenKind.BINOP) {
			acceptIt();
			parseExpression();
		}
	}


	private boolean startsStatement(TokenKind kind) {
		return kind == TokenKind.LCURLY ||
				startsType(kind) ||
				 startsReference(kind) ||
				  kind == TokenKind.RETURN ||
				   kind == TokenKind.IF ||
					kind == TokenKind.WHILE;
	}


	private boolean startsReference(TokenKind kind) {
		return kind == TokenKind.ID ||
				kind == TokenKind.THIS;
	}


	private void parseParameterList() throws SyntaxError {
		parseType();
		parseId();
		while (currentToken.kind == TokenKind.COMMA) {
			acceptIt();
			parseType();
			parseId();
		}
	}


	private void parseType() throws SyntaxError{
		switch (currentToken.kind) {
		case INT:
			acceptIt();
			if (currentToken.kind == TokenKind.LBRACKET) {
				acceptIt();
				accept(TokenKind.RBRACKET);
			}
			break;
		case BOOLEAN:
			acceptIt();
			break;
		case ID:
			parseId();
			if (currentToken.kind == TokenKind.LBRACKET) {
				acceptIt();
				accept(TokenKind.RBRACKET);
			}
			break;
		default:
			parseError("Wrong in parsing Type, currentToken is: " + currentToken);
		}
	}


	private void parseId() throws SyntaxError {
		accept(TokenKind.ID);
	}


	private void parseAccess() throws SyntaxError {
		if (currentToken.kind == TokenKind.STATIC) {
			accept(TokenKind.STATIC);
		}
	}


	private void parseVisibility() throws SyntaxError {
		if (currentToken.kind == TokenKind.PRIVATE) {
			accept(TokenKind.PRIVATE);
		} else if (currentToken.kind == TokenKind.PUBLIC) {
			accept(TokenKind.PUBLIC);
		}
	}


	private void parseClassDeclaration() throws SyntaxError {
		while (currentToken.kind == TokenKind.CLASS) {
			parseClassDeclaration();
		}
		accept(TokenKind.EOT);
	}

	/**
	 * accept current token and advance to next token
	 */
	private void acceptIt() throws SyntaxError {
		accept(currentToken.kind);
	}

	/**
	 * verify that current token in input matches expected token and advance to next token
	 * @param expectedToken
	 * @throws SyntaxError  if match fails
	 */
	private void accept(TokenKind expectedTokenKind) throws SyntaxError {
		if (currentToken.kind == expectedTokenKind) {
			currentToken = scanner.scan();
		}
		else
			parseError("Parsing " + currentToken.spelling + " and expecting '" + expectedTokenKind +
					"' but found '" + currentToken.kind + "'");
	}

	/**
	 * report parse error and unwind call stack to start of parse
	 * @param e  string with error detail
	 * @throws SyntaxError
	 */
	private void parseError(String e) throws SyntaxError {
		reporter.reportError("Parse error: " + e);
		throw new SyntaxError();
	}

	// show parse stack whenever terminal is  accepted
	private void pTrace() {
		StackTraceElement [] stl = Thread.currentThread().getStackTrace();
		for (int i = stl.length - 1; i > 0 ; i--) {
			if(stl[i].toString().contains("parse"))
				System.out.println(stl[i]);
		}
		System.out.println("accepting: " + currentToken.kind + " (\"" + currentToken.spelling + "\")");
		System.out.println();
	}

}

package miniJava.SyntacticAnalyzer;

public enum TokenKind {NUM, CLASS, ID, LBRACKET, RBRACKET, VOID, LPAREN, RPAREN, EOT, EQUAL, THIS,
							PUBLIC, PRIVATE, STATIC, INT, BOOLEAN, COMMA, DOT, RETURN, SEMICOLON,
								IF, ELSE, WHILE, UNOP, BINOP, BUNOP, TRUE, FALSE, NEW, LCURLY, RCURLY,
									ERROR}

package miniJava.SyntacticAnalyzer;

import java.io.IOException;
import java.io.InputStream;

import miniJava.ErrorReporter;
import miniJava.SyntacticAnalyzer.Token;
import miniJava.SyntacticAnalyzer.TokenKind;

public class Scanner {
	private boolean isComment;
	
//	comment state = 0 not comment
//			= 1 show /
//			= 2 show second /
//			= 12 show first *
//			= 13 show second *
//			= 3 show third /
//			= 4 show fourth / end of comment
//			= 14 show second / end of comment
	private int commentState;
	
	private InputStream inputStream;
	private ErrorReporter reporter;
	
	private char currentChar;
	private byte currentKind;
	private StringBuilder currentSpelling;
	
	// true when end of line is found
	private boolean eot = false; 
	
	public Scanner(InputStream inputStream, ErrorReporter reporter) {
		this.isComment = false;
		this.commentState = 0;
		this.inputStream = inputStream;
		this.reporter = reporter;

		// initialize scanner state
		readChar();
	}	
	
	/**
	 * skip whitespace and scan next token
	 */	
	
// ? SINGLE SLASH
//	comment state = 0 not comment
//	= 1 show /
//	= 2 show second /
//	= 12 show first *
//	= 13 show second *
//	= 14 show second / end of comment
	public void scanSeparator() {
		switch (commentState) {
			case 0:
				while (!eot && 
						(currentChar == ' ' ||
							currentChar == '\t' ||
								currentChar == '\n' ||
									currentChar == '\r')) {
					skipIt();
				}
				if (currentChar == '/') {
					commentState = 1;
					skipIt();
					scanSeparator();
				}
				break;
			
			case 1:
				if (currentChar == '/') {
					commentState = 2;
					isComment = true;
					skipIt();
					scanSeparator();
				} else if (currentChar == '*') {
					commentState = 12;
					isComment = true;
					skipIt();
					scanSeparator();
				} else {
					System.exit(4);
				}
				break;
			
			case 2:
				if (currentChar == '\r' || currentChar == '\n' || eot) {
					commentState = 0;
					isComment = false;
					scanSeparator();
				} else {
					skipIt();
					scanSeparator();		
				}
				break;
				
			case 12:
				if (eot) {
					System.exit(4);
				}
				if (currentChar != '*') {
					skipIt();
					scanSeparator();
				} else {
					commentState = 13;
					scanSeparator();
				}
				break;
			
			case 13:
				if (eot) {
					System.exit(4);
				}
				if (currentChar != '/') {
					skipIt();
					commentState = 12;
					scanSeparator();
				} else {
					commentState = 0;
					isComment = false;
					scanSeparator();
				}
				break;	
		}		
	}
	

	public Token scan() {
		// skip whitespace and comments
		scanSeparator();

		// start of a token: collect spelling and identify token kind
		currentSpelling = new StringBuilder();
		TokenKind kind = scanToken();
		String spelling = currentSpelling.toString();
		
		if (kind == TokenKind.ID) {
			switch (spelling) {
			case "class":
				kind = TokenKind.CLASS;
				break;
			case "public":
				kind = TokenKind.PUBLIC;
				break;
			case "private":
				kind = TokenKind.PRIVATE;
				break;
			case "static":
				kind = TokenKind.STATIC;
				break;
			case "int":
				kind = TokenKind.INT;
				break;
			case "boolean":
				kind = TokenKind.BOOLEAN;
				break;
			case "void":
				kind = TokenKind.VOID;
				break;
			case "this":
				kind = TokenKind.THIS;
				break;
			case "return":
				kind = TokenKind.RETURN;
				break;
			case "if":
				kind = TokenKind.IF;
				break;
			case "else":
				kind = TokenKind.ELSE;
				break;
			case "while":
				kind = TokenKind.WHILE;
				break;
			case "true":
				kind = TokenKind.TRUE;
				break;
			case "false":
				kind = TokenKind.FALSE;
				break;
			default:
				String[] ss = {"class","public","private","static","int","boolean","void","this","return","if","else","while","true","false"};
				for (String s : ss) {
					if (spelling.toLowerCase().equals(s)) {
						reporter.reportError("Key word should not be used as identifiers.");
						System.exit(4);
					}
				}
				break;
			}
		}

		// return new token
		return new Token(kind, spelling);
	}

	
	/**
	 * determine token kind
	 */
	public TokenKind scanToken() {
		if (eot) {
			return TokenKind.EOT; 
		}
			
		switch (currentChar) {
			case 'a':  case 'b':  case 'c':  case 'd':
			case 'e':  case 'f':  case 'g':  case 'h':
			case 'i':  case 'j':  case 'k':  case 'l':
			case 'm':  case 'n':  case 'o':  case 'p':
			case 'q':  case 'r':  case 's':  case 't':
	        case 'u':  case 'v':  case 'w':  case 'x':
	        case 'y':  case 'z':
	        
	        case 'A':  case 'B':  case 'C':  case 'D':
	        case 'E':  case 'F':  case 'G':  case 'H':
	        case 'I':  case 'J':  case 'K':  case 'L':
	        case 'M':  case 'N':  case 'O':	 case 'P':
	        case 'Q':  case 'R':  case 'S':  case 'T':
	        case 'U':  case 'V':  case 'W':  case 'X':
	        case 'Y':  case 'Z':
	        	takeIt();
	        	while(Character.isLetter(currentChar) 
	        			|| Character.isDigit(currentChar)
	        				|| currentChar == '_') {
	        		takeIt();
	        	}
	        	return TokenKind.ID;
	        
	        case '0':  case '1':  case '2':  case '3':  case '4':
	        case '5':  case '6':  case '7':  case '8':  case '9':
	            takeIt();
	            while(Character.isDigit(currentChar)) {
	            	takeIt();
	            }
	            return TokenKind.NUM;
	        
	        case '>': case '<': case '=':
	            takeIt();
	            if(currentChar == '=') {
	                takeIt();
	                return TokenKind.BINOP;
	            }
	            return TokenKind.BINOP;
	        
	        case '+': case '*': case '/':
	        	takeIt();
	        	return TokenKind.BINOP;
	        
	        case '&':
	            takeIt();
	            if(currentChar != '&') {
	                System.exit(4);
	            }
	            takeIt();
	            return TokenKind.BINOP;

	        case '|':
	            takeIt();
	            if(currentChar != '|')
	                System.exit(4);
	            takeIt();
	            return TokenKind.BINOP;
	        
	        case '!':
	            takeIt();
	            if(currentChar == '=') {
	                takeIt();
	                return TokenKind.BINOP;
	            }
	            return TokenKind.UNOP;
	            
	        case '-':
	            takeIt();
	            return TokenKind.MINUS;
	        
	        case '.':
	            takeIt();
	            return TokenKind.DOT;

	        case ',':
	            takeIt();
	            return TokenKind.COMMA;

	        case ';':
	            takeIt();
	            return TokenKind.SEMICOLON;

	        case '(':
	            takeIt();
	            return TokenKind.LPAREN;

	        case ')':
	            takeIt();
	            return TokenKind.RPAREN;

	        case '[':
	            takeIt();
	            return TokenKind.LBRACKET;

	        case ']':
	            takeIt();
	            return TokenKind.RBRACKET;

	        case '{':
	            takeIt();
	            return TokenKind.LCURLY;

	        case '}':
	            takeIt();
	            return TokenKind.RCURLY;
	        
	        default:
				scanError("Unrecognized character '" + currentChar + "' in input");
				return TokenKind.ERROR; 
		}
	}

	
	private void takeIt() {
		currentSpelling.append(currentChar);
		nextChar();
	}
	
	private void take(char expectedChar) {
		if (currentChar == expectedChar) {
			takeIt();
		}
	}

	private void skipIt() {
		nextChar();
	}


	private void scanError(String m) {
		reporter.reportError("Scan Error:  " + m);
	}


	private final static char eolUnix = '\n';
	private final static char eolWindows = '\r';

	/**
	 * advance to next char in inputstream
	 * detect end of file or end of line as end of input
	 */
	private void nextChar() {
		if (!eot)
			readChar();
	}

	private void readChar() {
		try {
			int c = inputStream.read();
			currentChar = (char) c;
			if (c == -1 || currentChar == eolUnix || currentChar == eolWindows) {
				eot = true;
			}
		} catch (IOException e) {
			scanError("I/O Exception!");
			eot = true;
		}
	}
	


}

package miniJava.SyntacticAnalyzer;

import miniJava.SyntacticAnalyzer.Scanner;
import miniJava.SyntacticAnalyzer.TokenKind;
import miniJava.ErrorReporter;

public class Parser {
	private Scanner scanner;
	private ErrorReporter reporter;
	private Token currentToken;

	public Parser(Scanner scanner, ErrorReporter reporter) {
		this.scanner = scanner;
		this.reporter = reporter;
	}


	/**
	 *  parse input, catch possible parse error
	 */
	public void parse() {
		currentToken = scanner.scan();
		try {
			parseProgram();
		}
		catch (SyntaxError e) { }
	}
	
	private boolean startsDeclaration(TokenKind kind) {
		return kind == TokenKind.PUBLIC ||
				kind == TokenKind.PRIVATE ||
				 kind == TokenKind.STATIC ||
				  startsType(kind) ||
					 kind == TokenKind.VOID;
	}
	
	private boolean startsType(TokenKind kind) {
		return kind == TokenKind.INT ||
				   kind == TokenKind.BOOLEAN ||
					kind == TokenKind.ID;
	}

	
	//   
	private void parseProgram() throws SyntaxError {
		accept(TokenKind.CLASS);
		parseId();
		accept(TokenKind.LCURLY);
		
		while (startsDeclaration(currentToken.kind)) {
			parseVisibility();
			parseAccess();
			switch(currentToken.kind) {
				case VOID:
					parseId();
					accept(TokenKind.LPAREN);
					if (startsType(currentToken.kind)) {
						parseParameterList();
					}
					accept(TokenKind.RPAREN);
					accept(TokenKind.LCURLY);
					
					while (startsStatement(currentToken.kind)) {
						parseStatement();
					}
					accept(TokenKind.RCURLY);
					break;
					
				default:
					if (startsType(currentToken.kind)) {
						parseType();
						parseId();
						switch(currentToken.kind) {
						case SEMICOLON:
							accept(TokenKind.SEMICOLON);
							break;
						case ID:
							parseId();
							accept(TokenKind.LPAREN);
							if (startsType(currentToken.kind)) {
								parseParameterList();
							}
							accept(TokenKind.RPAREN);
							accept(TokenKind.LCURLY);
							
							while (startsStatement(currentToken.kind)) {
								parseStatement();
							}
							accept(TokenKind.RCURLY);
							break;
						}
					}
					else {
						parseError("Parsing wrong in declarations");
					}
					
			}
		}
		
		accept(TokenKind.RCURLY);
		accept(TokenKind.EOT);
	}
	
	private void parseStatement() throws SyntaxError {
		switch (currentToken.kind) {
		case LCURLY:
			acceptIt();
			while (startsStatement(currentToken.kind)) {
				parseStatement();
			}
			accept(TokenKind.RCURLY);
			break;
			
		case INT: case BOOLEAN:
			parseType();
			parseId();
			accept(TokenKind.EQUAL);
			parseExpression();
			accept(TokenKind.SEMICOLON);
			break;
		
		case ID:
			acceptIt();
			
			switch (currentToken.kind) {
			// in Type
			case ID:
			acceptIt();
			accept(TokenKind.EQUAL);
			parseExpression();
			accept(TokenKind.SEMICOLON);
			break;
			
			// in Reference
			case EQUAL:
			acceptIt();
			parseExpression();
			accept(TokenKind.SEMICOLON);
			break;
			
			case LPAREN:
			acceptIt();
			if (currentToken.kind == TokenKind.RPAREN) {
				acceptIt();
			} else {
				parseArgumentList();
				accept(TokenKind.RPAREN);
			}
			accept(TokenKind.SEMICOLON);
			break;
			
			// both
			case LBRACKET: 
			acceptIt();
			// in Type
			if (currentToken.kind == TokenKind.RBRACKET) {
				acceptIt();
				accept(TokenKind.ID);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
			} else {
				// in Reference
				parseExpression();
				accept(TokenKind.RBRACKET);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
			}
			break;
			
			case DOT:
			while (currentToken.kind == TokenKind.DOT) {
				acceptIt();
				accept(TokenKind.ID);
			}
			switch (currentToken.kind) {
			case EQUAL:
				acceptIt();
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
			
			case LBRACKET: 
				acceptIt();
				parseExpression();
				accept(TokenKind.RBRACKET);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
			
			case LPAREN:
				acceptIt();
				if (currentToken.kind == TokenKind.RPAREN) {
					acceptIt();
				} else {
					parseArgumentList();
					accept(TokenKind.RPAREN);
				}
				accept(TokenKind.SEMICOLON);
				break;
			
			default:
				parseError("parsing statement, in subcase ID, in subcase DOT, current token is: " + currentToken);
			}
			default:
				parseError("parsing statement, in subcase ID, current token is: " + currentToken);
			}
			break;
		
		case THIS:
			acceptIt();
			while (currentToken.kind == TokenKind.DOT) {
				acceptIt();
				accept(TokenKind.ID);
			}
			switch (currentToken.kind) {
			case EQUAL:
				acceptIt();
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
			
			case LBRACKET:
				acceptIt();
				parseExpression();
				accept(TokenKind.RBRACKET);
				accept(TokenKind.EQUAL);
				parseExpression();
				accept(TokenKind.SEMICOLON);
				break;
				
			case LPAREN:
				acceptIt();
				if (currentToken.kind == TokenKind.RPAREN) {
					acceptIt();
					accept(TokenKind.SEMICOLON);
				} else {
					parseArgumentList();
					accept(TokenKind.RPAREN);
					accept(TokenKind.SEMICOLON);
				}
				break;
			
			default:
				parseError("parsing statement, in subcase THIS, current token is: " + currentToken);
			}
			break;
			
		case RETURN:
			acceptIt();
			if (currentToken.kind == TokenKind.SEMICOLON) {
				acceptIt();
			} else {
				parseExpression();
				accept(TokenKind.SEMICOLON);
			}
			break;
		
		case IF:
			acceptIt();
			accept(TokenKind.LPAREN);
			parseExpression();
			accept(TokenKind.RPAREN);
			parseStatement();
			if (currentToken.kind == TokenKind.ELSE) {
				acceptIt();
				parseStatement();
			}
			break;
			
		case WHILE:
			acceptIt();
			accept(TokenKind.LPAREN);
			parseExpression();
			accept(TokenKind.RPAREN);
			parseStatement();
			break;
		
		default:
			parseError("parsing statement, current token is:" + currentToken);
		}
		return ;
		
	}


	private void parseArgumentList() {
		// TODO Auto-generated method stub
		parseExpression();
		while (currentToken.kind == TokenKind.COMMA) {
			acceptIt();
			parseExpression();
		}
	}


	private void parseExpression() {
		// TODO Auto-generated method stub
		switch (currentToken.kind) {
		case ID: case THIS:
			acceptIt();
			while (currentToken.kind == TokenKind.DOT) {
				acceptIt();
				accept(TokenKind.ID);
			}
			switch (currentToken.kind) {
			case LBRACKET:
				acceptIt();
				parseExpression();
				accept(TokenKind.RBRACKET);
				break;
			
			case LPAREN:
				acceptIt();
				if (currentToken.kind == TokenKind.RPAREN) {
					acceptIt();
				} else {
					parseArgumentList();
					accept(TokenKind.RPAREN);
				}
				break;
				
			// just reference
			default:
				parseError("parsing expressiong, in subcase ID/THIS, current token is: " + currentToken);
			}
			
		case UNOP:
			acceptIt();
			parseExpression();
			break;
		
		case LPAREN:
			acceptIt();
			parseExpression();
			accept(TokenKind.RPAREN);
			break;
		
		case NUM: case TRUE: case FALSE:
			acceptIt();
			break;
		
		case NEW:
			acceptIt();
			switch (currentToken.kind) {
			case ID:
				acceptIt();
				switch (currentToken.kind) {
				case LPAREN:
					acceptIt();
					accept(TokenKind.RPAREN);
					break;
				case LBRACKET:
					acceptIt();
					parseExpression();
					accept(TokenKind.RBRACKET);
					break;
				
				}
			
			case INT:
				acceptIt();
				accept(TokenKind.LBRACKET);
				parseExpression();
				accept(TokenKind.RBRACKET);
				break;
			
			default:
				parseError("parsing expression, in subcase NEW, current token is: " + currentToken);
			}
			break;
		
		default:
			parseError("parsing expression, current token is: " + currentToken);
		}
		if (currentToken.kind == TokenKind.BINOP) {
			acceptIt();
			parseExpression();
		}
	}


	private boolean startsStatement(TokenKind kind) {
		return kind == TokenKind.LCURLY ||
				startsType(kind) ||
				 startsReference(kind) ||
				  kind == TokenKind.RETURN ||
				   kind == TokenKind.IF ||
					kind == TokenKind.WHILE;
	}


	private boolean startsReference(TokenKind kind) {
		return kind == TokenKind.ID ||
				kind == TokenKind.THIS;
	}


	private void parseParameterList() throws SyntaxError {
		parseType();
		parseId();
		while (currentToken.kind == TokenKind.COMMA) {
			acceptIt();
			parseType();
			parseId();
		}
	}


	private void parseType() throws SyntaxError{
		switch (currentToken.kind) {
		case INT:
			acceptIt();
			if (currentToken.kind == TokenKind.LBRACKET) {
				acceptIt();
				accept(TokenKind.RBRACKET);
			}
			break;
		case BOOLEAN:
			acceptIt();
			break;
		case ID:
			parseId();
			if (currentToken.kind == TokenKind.LBRACKET) {
				acceptIt();
				accept(TokenKind.RBRACKET);
			}
			break;
		default:
			parseError("Wrong in parsing Type, currentToken is: " + currentToken);
		}
	}


	private void parseId() throws SyntaxError {
		accept(TokenKind.ID);
	}


	private void parseAccess() throws SyntaxError {
		if (currentToken.kind == TokenKind.STATIC) {
			accept(TokenKind.STATIC);
		}
	}


	private void parseVisibility() throws SyntaxError {
		if (currentToken.kind == TokenKind.PRIVATE) {
			accept(TokenKind.PRIVATE);
		} else if (currentToken.kind == TokenKind.PUBLIC) {
			accept(TokenKind.PUBLIC);
		}
	}


	private void parseClassDeclaration() throws SyntaxError {
		while (currentToken.kind == TokenKind.CLASS) {
			parseClassDeclaration();
		}
		accept(TokenKind.EOT);
	}

	/**
	 * accept current token and advance to next token
	 */
	private void acceptIt() throws SyntaxError {
		accept(currentToken.kind);
	}

	/**
	 * verify that current token in input matches expected token and advance to next token
	 * @param expectedToken
	 * @throws SyntaxError  if match fails
	 */
	private void accept(TokenKind expectedTokenKind) throws SyntaxError {
		if (currentToken.kind == expectedTokenKind) {
			currentToken = scanner.scan();
		}
		else
			parseError("Parsing " + currentToken.spelling + " and expecting '" + expectedTokenKind +
					"' but found '" + currentToken.kind + "'");
	}

	/**
	 * report parse error and unwind call stack to start of parse
	 * @param e  string with error detail
	 * @throws SyntaxError
	 */
	private void parseError(String e) throws SyntaxError {
		reporter.reportError("Parse error: " + e);
		throw new SyntaxError();
	}

	// show parse stack whenever terminal is  accepted
	private void pTrace() {
		StackTraceElement [] stl = Thread.currentThread().getStackTrace();
		for (int i = stl.length - 1; i > 0 ; i--) {
			if(stl[i].toString().contains("parse"))
				System.out.println(stl[i]);
		}
		System.out.println("accepting: " + currentToken.kind + " (\"" + currentToken.spelling + "\")");
		System.out.println();
	}

}

